import { useForm } from "react-hook-form";
import "./BuyMovie.css";
import BuyModel from "../../../Models/buy-model";
import notify from "../../../Utils/Notify";
import moviesService from "../../../Services/movies-service";
import BuyMovieCard from "../BuyMovieCard/BuyMovieCard";
import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { MovieState } from "../../../Redux/MovieRedux";
import { buyStore } from "../../../Redux/BuyModel";

function BuyMovie(){

    const [buy, setBuy] = useState<BuyModel[]>([]);
    const params = useParams();


    useEffect(() => {
        moviesService.getAllBuys()
            .then(buy => setBuy(buy))
            .catch(err => notify.error(err))
    }, [])

    useEffect(() => {
        console.log();
        try {
            moviesService.getAllBuys()

            buyStore.subscribe(() => {
                const dup = [...buyStore.getState().buy];
                setBuy(dup);
            })
        } catch (err: any) {
            alert(err.message)
        }
    }, [])



    return (
        <div className="BuyMovie">
			<h1>buy movie</h1>
            <div className="cardDiv">

                {buy.map((item) => <BuyMovieCard key={item.buyId} buy={item} />)}
            </div>
        </div>
    );
}

export default BuyMovie;
